import React, { Component } from "react";

class NrMen extends Component {
  render() {
    const { secondbox } = this.props;
    // console.log(i);
    return (
      <li className="nrMenItem">
        {/* <a className="nrMenLink" href> */}
        <a className={this.props.index === 0 ? "nrMenLinkMain" : "nrMenLink"}>
          {secondbox}
        </a>
      </li>
    );
  }
}

export default NrMen;
